message:
IMPOSSÍVEL O MOLUSCO E SUA CORJA ASSUMIR: 12 MOTIVOS
(SÃO CENTENAS DE MOTIVOS, EIS UM RESUMO)
1-ESTE MOLUSCO ‘SAIU DE CENA’’ FAZ ALGUNS ANOS;
2-O ATUAL FAKE ATÉ TEM OS DEZ DEDOS (VIDEOS COMPROVAM);
3-ESTE FAKE, NA VERDADE, USA  ‘’MÁSCARA’’ (PRA VARIAR);
4-SEMPRE HOUVE FRAUDES COM ESTAS URNAS VENEZUELANAS
MAS DESTA VEZ FOI ‘’ESCANCARADO’’ E AO VIVO!;
5-É OBRIGATÓRIO FAZER PROVA DE VIDA (ANTECEDENTES);
6-A QUADRILHA PT-STF-TSE-MÍDIA FOI DESMASCARADA;
7-ESTAMOS EM LEI MARCIAL E FAZ UNS ANOS;
8-OS MILITARES ‘’NÃO SE VENDEM’’, CUMPREM A CONSTITUIÇÃO;
9-AUDITORIA DAS FRAUDES ESTÃO PRONTAS, O MUNDO SABE TUDO;
10-SABEM O QUE É ‘’CÓDIGO FONTE’’? ONDE ESTÁ?
11-O POVO EXIGE JUSTIÇA E ‘’PAROU O PAÍS’’;
12-CRIMINOSOS JULGADO E CONDENADO EM TRÊS INSTÂNCIAS!!!
